description:
Download the TUI (PL/CZ) application and choose your dream holiday. Gain access to the best travel and hotel offers. The application allows you to:
- create a list of favourite hotels and trips;
- access special offers, discounts, reservations, and last-minute travel;
- view your search history – with TUI (PL/CZ), you won't miss any opportunity!
- browse full-resolution hotel photo galleries and access detailed property descriptions;
- access TripAdvisor user reviews;
- share tour offers with your loved ones via SMS, Facebook, Messenger, WhatsApp, and many other applications;
- easy access to myTUI, where you will find your travel documents, departure times, and other useful data.

Well-organised holidays are within your reach. Thanks to myTUI, you have:
- insight into current and historical holiday and hotel bookings in the app;
- the ability to check flight departure times, payment status for trips, and baggage allowances;
- downloadable travel documents;
- directions to the hotel in myTUI for self-organised travelers;
- a meal configurator for package tours.
Hundreds of travel offers around the world available in one free application? With TUI (PL/CZ), it's possible!

Are you looking for a relaxing break in an exotic and distant corner of the world, organised all-inclusive holidays, or self-drive travel? Or maybe you prefer to spend your free time actively and are interested in package tours? The free application "TUI (PL/CZ)" is the perfect tool, thanks to which you won't miss any special holiday offer and will book your dream trip and the best hotel wherever you are.

The TUI (PL/CZ) hotel and trip offer was created with your needs in mind.

You can choose from the most beautiful European destinations: Greece, Bulgaria, Spain, Canary Islands, Cyprus, Madeira, Croatia, Sicily, Sardinia, Portugal, Turkey, as well as exotic destinations: Dominican Republic, Mexico, Kenya, Zanzibar, Thailand, Cape Verde, Mauritius, Sri Lanka, United Arab Emirates, Jamaica, or Albania.

With the application "TUI (PL/CZ)," you can easily choose the ideal holiday offer at an attractive price!

All TUI promotions are available in the application. Thanks to the coloured ribbons, you will know whether your selected holidays, package tours, or hotel offers are discounted. The application will also provide you with information about price changes for tours or other offers.

With TUI (PL/CZ), you can quickly and easily find the best holiday and hotel offers.

Advanced filtering and sorting options will allow you to choose holidays tailored to your needs. You can use the calendar of upcoming offers, which:
- will suggest specific departure days;
- will indicate the availability date for first and last minute holiday offers;
- the minimum price for which you can buy a trip on a given day;
- the number of available rooms in hotels.

Fast and intuitive holiday booking with the TUI Poland application
Don't waste time repeatedly entering the same data. Thanks to the TUI application, the birthdays of your children, once entered, will be remembered by the application until you change them :)

We are intensively working on further functionalities in the TUI application, which is why we would like to know your opinion about it. Every suggestion, need, and idea is very important to us. We encourage you to send messages to ios@tui.pl.
